import React from 'react';
import shadows from "../src/img/web.jpg"
import Common from "./Common";
const About = () => {
    return (
        <>
            <Common name="Grow Your Business with" imgsrc={shadows} btnname="Get Started" visit="/service"/>
        </>
    )
}

export default About;
